import React from 'react';
import { Estimate } from '../types';

interface EstimatePanelProps {
  estimate: Estimate;
  onEstimateChange: (field: keyof Estimate, value: any) => void;
  onSendSMS: () => void;
  onSendEmail: () => void;
  onDownloadPDF: () => void;
  onCopyCSV: () => void;
}

export default function EstimatePanel({
  estimate,
  onEstimateChange,
  onSendSMS,
  onSendEmail,
  onDownloadPDF,
  onCopyCSV
}: EstimatePanelProps) {
  return (
    <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
      <h2 className="text-lg font-semibold text-gray-900 mb-4">Estimate</h2>

      {/* Input Fields */}
      <div className="space-y-4 mb-6">
        {/* Crew Size */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Crew Size
          </label>
          <select
            value={estimate.crew}
            onChange={(e) => onEstimateChange('crew', parseInt(e.target.value))}
            className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
          >
            {[2, 3, 4, 5, 6].map(size => (
              <option key={size} value={size}>{size} people</option>
            ))}
          </select>
        </div>

        {/* Hourly Rate */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Hourly Rate ($)
          </label>
          <input
            type="number"
            value={estimate.rate}
            onChange={(e) => onEstimateChange('rate', parseFloat(e.target.value) || 0)}
            className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
            min="0"
            step="0.01"
          />
        </div>

        {/* Travel Time */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Travel Time (minutes)
          </label>
          <input
            type="number"
            value={estimate.travelMins}
            onChange={(e) => onEstimateChange('travelMins', parseInt(e.target.value) || 0)}
            className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
            min="0"
          />
        </div>

        {/* Toggle Options */}
        <div className="space-y-3">
          <div className="flex items-center justify-between">
            <label className="text-sm font-medium text-gray-700">Stairs</label>
            <button
              onClick={() => onEstimateChange('stairs', !estimate.stairs)}
              className={`relative inline-flex h-6 w-11 items-center rounded-full transition-colors ${
                estimate.stairs ? 'bg-blue-600' : 'bg-gray-200'
              }`}
            >
              <span
                className={`inline-block h-4 w-4 transform rounded-full bg-white transition-transform ${
                  estimate.stairs ? 'translate-x-6' : 'translate-x-1'
                }`}
              />
            </button>
          </div>

          <div className="flex items-center justify-between">
            <label className="text-sm font-medium text-gray-700">Elevator</label>
            <button
              onClick={() => onEstimateChange('elevator', !estimate.elevator)}
              className={`relative inline-flex h-6 w-11 items-center rounded-full transition-colors ${
                estimate.elevator ? 'bg-blue-600' : 'bg-gray-200'
              }`}
            >
              <span
                className={`inline-block h-4 w-4 transform rounded-full bg-white transition-transform ${
                  estimate.elevator ? 'translate-x-6' : 'translate-x-1'
                }`}
              />
            </button>
          </div>

          <div className="flex items-center justify-between">
            <label className="text-sm font-medium text-gray-700">Wrapping</label>
            <button
              onClick={() => onEstimateChange('wrapping', !estimate.wrapping)}
              className={`relative inline-flex h-6 w-11 items-center rounded-full transition-colors ${
                estimate.wrapping ? 'bg-blue-600' : 'bg-gray-200'
              }`}
            >
              <span
                className={`inline-block h-4 w-4 transform rounded-full bg-white transition-transform ${
                  estimate.wrapping ? 'translate-x-6' : 'translate-x-1'
                }`}
              />
            </button>
          </div>
        </div>

        {/* Safety Factor */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Safety Factor ({estimate.safetyPct}%)
          </label>
          <input
            type="range"
            min="0"
            max="20"
            value={estimate.safetyPct}
            onChange={(e) => onEstimateChange('safetyPct', parseInt(e.target.value))}
            className="w-full h-2 bg-gray-200 rounded-lg appearance-none cursor-pointer"
          />
          <div className="flex justify-between text-xs text-gray-500 mt-1">
            <span>0%</span>
            <span>20%</span>
          </div>
        </div>
      </div>

      {/* Read-only Results */}
      <div className="bg-gray-50 rounded-lg p-4 mb-6">
        <h3 className="text-sm font-medium text-gray-700 mb-3">Estimate Results</h3>
        <div className="space-y-2">
          <div className="flex justify-between">
            <span className="text-sm text-gray-600">Est. Hours:</span>
            <span className="text-sm font-medium text-gray-900">{estimate.hours}</span>
          </div>
          <div className="flex justify-between">
            <span className="text-sm text-gray-600">Est. Total:</span>
            <span className="text-sm font-medium text-gray-900">${estimate.total.toLocaleString()}</span>
          </div>
          <div className="flex justify-between">
            <span className="text-sm text-gray-600">Recommended Crew:</span>
            <span className="text-sm font-medium text-gray-900">{estimate.crew} people</span>
          </div>
        </div>
      </div>

      {/* Action Buttons */}
      <div className="space-y-2">
        <button
          onClick={onSendSMS}
          className="w-full bg-green-600 text-white px-4 py-2 rounded-md hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-green-500 focus:ring-offset-2 transition-colors"
        >
          Send SMS Quote
        </button>
        <button
          onClick={onSendEmail}
          className="w-full bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition-colors"
        >
          Send Email
        </button>
        <button
          onClick={onDownloadPDF}
          className="w-full bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700 focus:outline-none focus:ring-2 focus:ring-red-500 focus:ring-offset-2 transition-colors"
        >
          Download PDF
        </button>
        <button
          onClick={onCopyCSV}
          className="w-full bg-gray-600 text-white px-4 py-2 rounded-md hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-gray-500 focus:ring-offset-2 transition-colors"
        >
          Copy CSV
        </button>
      </div>
    </div>
  );
}
